import React from 'react'
import styled from 'styled-components'
// import rgba from './bensLibrary'

const H1 = styled.h1`
  color: ${props => props.theme.accent}
`

export default function Text (props) {
  return (
    props.type === 'h1' && <H1>{props.children}</H1>
  )
}
